"use strict";angular.module("datetimeFilter",[]).filter("upcoming",[function(){return function(a,b){if(!Array.isArray(a))return a;for(var c=new Date,d=[],e=0;e<a.length;e++){var f=a[e],g=new Date(f[b]);c.getTime()<g.getTime()&&d.push(f)}return d}}]);